// Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';

const Navbar = () => {
  const { userRole } = useSelector(state => state.charity);

  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        {userRole === 'donor' && (
          <>
            <li><Link to="/donations">Donate</Link></li>
            <li><Link to="/donation-history">Donation History</Link></li>
          </>
        )}
        {userRole === 'charity' && (
          <>
            <li><Link to="/charity-application">Apply as a Charity</Link></li>
            <li><Link to="/charity-dashboard">Charity Dashboard</Link></li>
          </>
        )}
        {userRole === 'admin' && (
          <li><Link to="/admin-dashboard">Admin Dashboard</Link></li>
        )}
      </ul>
    </nav>
  );
};

export default Navbar;
